                imgUrl: projImg1
            },
            {
                title: "Niner-Spikeball-Network",
                description: "placeholder2",
                imgUrl: projImg2
            },
            {
                title: "MyHealthPal",
                description: "placeholder3",
                imgUrl: projImg2
            },

        ]
        return (
            <section className="project" id="project">
                <Container>
                    <Row>
                        <Col>
                        <h2>Projects</h2>
                        </Col>
                    </Row>
                </Container>
            </section>
        )
}
